    "%matplotlib inline\n",
    "\n",
    "import cv2\n",
    "import math\n",
    "from matplotlib import pyplot as plt\n",
    "\n",
    "THRESHOLD_VALUE = 127\n",
    "ROWS = 1\n",
    "COLS = 2\n",
    "\n",
    "img = cv2.imread('../imgs/building.png')\n",
    "_, th = cv2.threshold(img, THRESHOLD_VALUE, 255, cv2.THRESH_BINARY)\n",
    "\n",
    "titles = ['Original Image', 'Thresholding (value = 127)']\n",
    "images = [img, th]\n",
    "\n",
    "_, axarr = plt.subplots(ROWS, COLS)\n",
    "for i, _ in enumerate(titles):\n",
    "    axarr[i].set_title(titles[i])\n",
    "    axarr[i].imshow(images[i], cmap='gray')\n",
    "    \n",
    "plt.show()"
