   "source": [
    "ROWS = 2\n",
    "COLS = 2\n",
    "GREYSCALE = 0\n",
    "FILTER_SIZE = 5\n",
    "THRESHOLD_VALUE = 127\n",
    "BLOCK_SIZE = 11\n",
    "CONSTANT_SUBTRACTED = 2\n",
    "\n",
    "# adaptiveThreshold only accept greyscale format\n",
    "img = cv2.imread('../imgs/sudoku.jpg', GREYSCALE)\n",
    "img = cv2.medianBlur(img, FILTER_SIZE)\n",
    "\n",
    "_,th1 = cv2.threshold(img,THRESHOLD_VALUE,255,cv2.THRESH_BINARY)\n",
    "th2 = cv2.adaptiveThreshold(img,255,cv2.ADAPTIVE_THRESH_MEAN_C, cv2.THRESH_BINARY, BLOCK_SIZE, CONSTANT_SUBTRACTED)\n",
    "th3 = cv2.adaptiveThreshold(img,255,cv2.ADAPTIVE_THRESH_GAUSSIAN_C, cv2.THRESH_BINARY, BLOCK_SIZE, CONSTANT_SUBTRACTED)\n",
    "\n",
    "titles = [\n",
    "    'Original Image', \n",
    "    'Global Thresholding (v = 127)',\n",
    "    'Adaptive Mean Thresholding', \n",
    "    'Adaptive Gaussian Thresholding']\n",
    "\n",
    "images = [img, th1, th2, th3]\n",
    "    \n",
    "_, axarr = plt.subplots(ROWS, COLS, figsize=(16, 16))\n",
    "for i, _ in enumerate(titles):\n",
    "    axarr[math.floor(i/COLS), i%COLS].set_title(titles[i])\n",
    "    axarr[math.floor(i/COLS), i%COLS].imshow(images[i], cmap='gray')\n",
    "    \n",
    "plt.show()"
   ]
